import React, { useEffect, useState } from 'react';
import { RandonUserApi } from '../../routes/constants';
import { ContainerBase } from '../../style';
import { ContainerPage, ContainerAction } from './style';

export default function FirstPage() {

   const [renderUser, setRenderUser] = useState([])

   useEffect(()=>{
      axios
         .get(RandonUserApi)
         .then((resp)=>{
            setRenderUser(resp.data) 
            console.log(resp.data);})
   },[])

 return (
   <ContainerBase>
      <ContainerPage>
         {renderUser.map(()=>{})}
      </ContainerPage>
      <ContainerAction></ContainerAction>
   </ContainerBase>
 );
}
